import React, { useEffect, useState,useRef } from 'react';

const cardRefs = useRef([]);


const checklistLabels = [
  "सर्विस हिस्ट्री देखें और ग्राहक को सुझाव दें",
  "गियर ऑयल स्तर जांचें",
  "इंजन ऑयल स्तर जांचें",
  "डिफरेंशियल ऑयल स्तर जांचें",
  "कूलेंट स्तर जांचें",
  "ब्रेक सेटिंग और ब्रेक लाइनर जांचें",
  "क्लच सेटिंग और क्लच पार्ट्स जांचें",
  "व्हील अलाइनमेंट के लिए सुझाव दें",
  "फ्रंट सस्पेंशन चेक करें",
  "सभी एयर होसेस जांचें",
  "फ्यूल पाइप जांचें",
  "कूलंट पाइप जांचें",
  "बैटरी की स्थिति और इंडिकेटर जांचें",
  "इंजन माउंटिंग जांचें",
  "टैंक कैप और डीजल टैंक कैप जांचें",
  "स्टेरिंग ऑयल स्तर और लीक जांचें",
  "हेडलाइट, वाटर बल्ब, फ्यूज जांचें",
  "वाइपर ब्लेड जांचें",
  "लेवल वाल्व जांचें",
  "फैन बेल्ट जांचें",
  "डिफरेंशियल बेल्ट जांचें",
  "रेट्रो जांचें"
];

const ViewEntries = () => {
  const [entries, setEntries] = useState([]);

  useEffect(() => {
    fetch('https://script.google.com/macros/s/AKfycbxGOGGJ1xCS0K_Qm7K7EHJK-XefCNzv3373Sr63T-IeH6-uca1_rL05plem95w0IUpkng/exec')
      .then((res) => res.json())
      .then((data) => setEntries(data))
      .catch((err) => console.error(err));
  }, []);

  const formatDate = (rawDate) => {
    const d = new Date(rawDate);
    if (isNaN(d)) return '—';
    return d.toLocaleDateString('hi-IN');
  };

  const formatTime = (rawTime) => {
    const t = new Date(rawTime);
    if (isNaN(t)) return '—';
    return t.toLocaleTimeString('hi-IN');
  };

 const renderSummary = (items) => {
  const notOk = items
    .map((item, i) => item.status === 'नहीं' ? `${i + 1}. ${item.label || checklistLabels[i]} — ${item.remark}` : null)
    .filter(Boolean);

  if (notOk.length === 0) {
    return <span style={{ color: 'green' }}>✅ All OK</span>;
  }

  return (
    <div style={{ color: 'red' }}>
      {notOk.map((item, i) => (
        <div key={i}>❌ {item}</div>
      ))}
      <div>✅ Other All OK</div>
    </div>
  );
};


  return (
    <div className="entries-card-list">
      <h2 style={{ textAlign: 'center' }}>📋 सभी चेकशीट एंट्री</h2>
      <div className="card-grid">



       {entries.map((entry, index) => {
  const handlePrint = () => {
    const printWindow = window.open('', '', 'width=800,height=600');
    printWindow.document.write(`
      <html>
        <head>
          <title>Print Entry</title>
          <style>
            body {
              font-family: 'Segoe UI', sans-serif;
              padding: 20px;
            }
            .entry-card {
              border: 1px solid #ccc;
              padding: 16px;
              border-radius: 8px;
              max-width: 600px;
              margin: auto;
            }
            .card-row {
              margin: 8px 0;
            }
            .card-row strong {
              color: #007bff;
            }
          </style>
        </head>
        <body>
          ${cardRefs.current[index].innerHTML}
        </body>
      </html>
    `);
    printWindow.document.close();
    printWindow.focus();
    printWindow.print();
    printWindow.close();
  };

  return (
    <div
      className="entry-card"
      key={index}
      ref={(el) => (cardRefs.current[index] = el)}
    >
      <div className="card-row"><strong>वाहन नंबर:</strong> {entry.registration}</div>
      <div className="card-row"><strong>KM:</strong> {entry.kilometers}</div>
      <div className="card-row"><strong>मॉडल:</strong> {entry.model}</div>
      <div className="card-row"><strong>तारीख:</strong> {formatDate(entry.date)}</div>
      <div className="card-row"><strong>समय:</strong> {formatTime(entry.time)}</div>
      <div className="card-row"><strong>स्थिति:</strong> {renderSummary(entry.items)}</div>

      <button
        onClick={handlePrint}
        style={{
          marginTop: '10px',
          padding: '6px 10px',
          backgroundColor: '#ffc107',
          border: 'none',
          borderRadius: '6px',
          cursor: 'pointer',
        }}
      >
        🖨️ प्रिंट
      </button>
    </div>
  );
})}




      </div>
    </div>
  );
};

export default ViewEntries;
